  if(startAt) {
    start = startAt;
  } else {
    if(process.env.SERVER_ENV) {
      start = process.hrtime();
    } else if(process.env.BROWSER_ENV) {
      if(window.performance) {
        start = window.performance.now();
      } else {
        start = new Date();
